(1023, 1, '2018-02-01 11:29:42', '2018-02-01 10:29:42', '[vc_row][vc_column][vc_single_image image=\"101\" img_size=\"full\" alignment=\"center\"][vc_column_text]Lorem Ipsum jest tekstem stosowanym jako przykadowy wypeniacz w przemyle poligraficznym. Zosta po raz pierwszy uyty w XV w. przez nieznanego drukarza do wypenienia tekstem prbnej ksiki. Pi wiekw pniej zacz by uywany przemyle elektronicznym, pozostajc praktycznie niezmienionym. Spopularyzowa si w latach 60. XX w. wraz z publikacj arkuszy Letrasetu, zawierajcych fragmenty Lorem Ipsum, a ostatnio z zawierajcym rne wersje Lorem Ipsum oprogramowaniem przeznaczonym do realizacji drukw na komputerach osobistych, jak Aldus PageMaker.\r\n\r\nW przeciwiestwie do rozpowszechnionych opinii, Lorem Ipsum nie jest tylko przypadkowym tekstem. Ma ono korzenie w klasycznej aciskiej literaturze z 45 roku przed Chrystusem, czyli ponad 2000 lat temu! Richard McClintock, wykadowca aciny na uniwersytecie Hampden-Sydney w Virginii, przyjrza si uwaniej jednemu z najbardziej niejasnych sw w Lorem Ipsum  consectetur  i po wielu poszukiwaniach odnalaz niezaprzeczalne rdo: Lorem Ipsum pochodzi z fragmentw (1.10.32 i 1.10.33) de Finibus Bonorum et Malorum, czyli O granicy dobra i za, napisanej wanie w 45 p.n.e. przez Cycerona. Jest to bardzo popularna w czasach renesansu rozprawa na temat etyki. Pierwszy wiersz Lorem Ipsum, Lorem ipsum dolor sit amet... pochodzi wanie z sekcji 1.10.32.[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][vc_column_text]W przeciwiestwie do rozpowszechnionych opinii, Lorem Ipsum nie jest tylko przypadkowym tekstem. Ma ono korzenie w klasycznej aciskiej literaturze z 45 roku przed Chrystusem, czyli ponad 2000 lat temu! Richard McClintock, wykadowca aciny na uniwersytecie Hampden-Sydney w Virginii, przyjrza si uwaniej jednemu z najbardziej niejasnych sw w Lorem Ipsum  consectetur  i po wielu poszukiwaniach odnalaz niezaprzeczalne rdo: Lorem Ipsum pochodzi z fragmentw (1.10.32 i 1.10.33) de Finibus Bonorum et Malorum, czyli O granicy dobra i za, napisanej wanie w 45 p.n.e. przez Cycerona. Jest to bardzo popularna w czasach renesansu rozprawa na temat etyki. Pierwszy wiersz Lorem Ipsum, Lorem ipsum dolor sit amet... pochodzi wanie z sekcji 1.10.32.[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][/vc_column][/vc_row]', 'Tytu aktualnoci 1', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Fusce vitae mauris nullam sit amet quam eu dui ornare iaculis. Donec ultrices leo ac nulla. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices.', 'inherit', 'closed', 'closed', '', '1018-revision-v1', '', '', '2018-02-01 11:29:42', '2018-02-01 10:29:42', '', 1018, 'http://192.168.1.42/beauty/2018/02/01/1018-revision-v1/', 0, 'revision', '', 0);
