(1113, 1, '2018-02-06 10:12:55', '2018-02-06 09:12:55', '<strong>Mikrodermabrazja</strong> jest nowoczesn metod peelingu mechanicznego. jest zabiegiem cakowicie bezpiecznym, ktry nie narusza struktury skry waciwej.\r\n\r\nMikrodermabrazja przeprowadzana jest przy uyciu specjalnie do tego celu przystosowanych gowic cierajcych, ktrych powierzchnia zostaa pokryta drobinkami naturalnego bd syntetycznego diamentu. Zabieg jest cakowicie bezbolesny.\r\n\r\n<strong>Wskazania:</strong>\r\n<ul>\r\n 	<li>pytkie zmarszczki;</li>\r\n 	<li>blizny;</li>\r\n 	<li>rozstpy;</li>\r\n 	<li>nadmierne rogowacenie naskrka;</li>\r\n 	<li>zmiany powstae w wyniku fotostarzenia;</li>\r\n 	<li>brak napicia i elastycznoci skry;</li>\r\n 	<li>przebarwiania;</li>\r\n 	<li>rogowacenie okoomieszkowe;</li>\r\n 	<li>trdzik pospolity bez stanw zapalnych.</li>\r\n 	<li>zaskrniki</li>\r\n</ul>\r\n<b>Przeciwwskazania</b><strong>:</strong>\r\n<ul>\r\n 	<li>zakaenia grzybicze;</li>\r\n 	<li>zakaenia wirusowe  brodawki, opryszczka itd.;</li>\r\n 	<li>zakaenia bakteryjne  liszajec, zapalenie mieszkw wosowych;</li>\r\n 	<li>nowotwory skry;</li>\r\n 	<li>znamiona;</li>\r\n 	<li>trdzik rowaty i grudkowo-krostkowy;</li>\r\n 	<li>uszkodzenia cigoci skry;</li>\r\n</ul>\r\nCzas zabiegu: od 30 do 60 min\r\nPo zabiegu mikrodermabrazji naley unika opalania przez co najmniej 2 tygodnie, a take sauny i basenu przez co najmniej tydzie.', 'Mikrodermabrazja', '', 'publish', 'closed', 'closed', '', 'mikrodermabrazja', '', '', '2018-02-06 10:12:55', '2018-02-06 09:12:55', '', 984, 'http://192.168.1.42/beauty/?page_id=1113', 0, 'page', '', 0),
