(1116, 1, '2018-02-06 10:27:57', '2018-02-06 09:27:57', '<strong>Peeling kawitacyjny</strong> to innowacyjna i komfortowa metoda oczyszczania skry za pomoc wibracji ultradwikowej, wzbogacona o mikromasa, ktry poprawia mikrokrenie i dotlenienie komrkowe oraz zwiksza penetracj substancji aktywnych w gb skry. Kawitacja zapewnia dokadne oczyszczenie skry z zalegajcej warstwy zrogowaciaego naskrka, toksyn oraz wydzielin gruczow ojowych, a przy tym jest to zabieg cakowicie bezbolesny.\r\n\r\n<strong>Wskazania:</strong>\r\n<ul>\r\n 	<li>trdzik pospolity i rowaty;</li>\r\n 	<li>zaskrniki;</li>\r\n 	<li>wgry;</li>\r\n 	<li>rozszerzone pory;</li>\r\n 	<li>przetuszczajca si skra;</li>\r\n 	<li>niejednolity koloryt,</li>\r\n 	<li>skra wymagajce regeneracji</li>\r\n</ul>\r\n<b>Przeciwwskazania:</b>\r\n<ul>\r\n 	<li>nowotwory</li>\r\n 	<li>cia</li>\r\n 	<li>ostre/ropne stany zapalne skry</li>\r\n 	<li>cika niewydolno krenia</li>\r\n 	<li>obecno w ciele czci metalowych (np.: rozrusznik serca, aparat na zbach)</li>\r\n</ul>\r\nCzas zabiegu: od 30 do 45 min.', 'Peeling kawitacyjny', '', 'publish', 'closed', 'closed', '', 'peeling-kawitacyjny', '', '', '2018-02-06 10:27:57', '2018-02-06 09:27:57', '', 984, 'http://192.168.1.42/beauty/?page_id=1116', 0, 'page', '', 0),
