(1121, 1, '2018-02-06 10:53:58', '2018-02-06 09:53:58', 'Jeli liczysz na profesjonaln pomoc w oczyszczeniu Twojej cery z widocznych zaskrnikw i borykasz si z problemem rozszerzonych porw, moesz skorzysta z zabiegu oczyszczania manualnego. Zabieg czy aktywno skadnikw o dziaaniu przeciwbakteryjnym, agodzcym i cigajcym z klasyczn technik rcznego usuwania zaskrnikw.\r\n\r\n<strong>Wskazania:</strong>\r\n<ul>\r\n 	<li> skra zanieczyszczona, trdzik zaskrnikowy</li>\r\n</ul>\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>dua ilo stanw zapalnych;</li>\r\n 	<li>opryszczka;</li>\r\n 	<li>stany alergiczne;</li>\r\n 	<li>tendencja do powstawania blizn;</li>\r\n 	<li>trdzik rowaty;</li>\r\n 	<li>skra naczyniowa</li>\r\n</ul>\r\nCzas trwania: od 60 do 90 min.', 'Oczyszczanie manualne', '', 'publish', 'closed', 'closed', '', 'oczyszczanie-manualne', '', '', '2018-02-06 10:53:58', '2018-02-06 09:53:58', '', 984, 'http://192.168.1.42/beauty/?page_id=1121', 0, 'page', '', 0),
