(1130, 1, '2018-02-06 11:00:20', '2018-02-06 10:00:20', 'Zabieg przeznaczony dla osb ze skr szar, zmczon, le odywion, zwiotcza, niedotlenion, pozbawion elastycznoci, jdrnoci i blasku. Szczeglnie polecany osobom yjcym w cigym stresie i przemczeniu. Zalecany jest rwnie profilaktycznie osobom chccym jak najduej cieszy si modoci swojej skry.\r\n\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>przerwanie cigoci tkanek w miejscu zabiegu,</li>\r\n 	<li>mikro razy,</li>\r\n 	<li>zabiegi chirurgiczne w obrbie twarzy (do 2 miesicy),</li>\r\n 	<li>infekcje bakteryjne i wirusowe,</li>\r\n 	<li>choroby skry,</li>\r\n 	<li>zakaenia skry,</li>\r\n 	<li>stany gorczkowe,</li>\r\n 	<li>choroby zakane</li>\r\n</ul>\r\nCzas trwania: od 30 do 45 min.', 'Masa twarzy, szyi i dekoltu', '', 'publish', 'closed', 'closed', '', 'masaz-twarzy-szyi-i-dekoltu', '', '', '2018-02-06 11:00:20', '2018-02-06 10:00:20', '', 984, 'http://192.168.1.42/beauty/?page_id=1130', 0, 'page', '', 0),
