(1134, 1, '2018-02-06 12:07:44', '2018-02-06 11:07:44', 'Niezwykle skuteczny zabieg poprawiajcy wygld i kondycj skry. Oparty na bezbolesnej, nieinwazyjnej i bezpiecznej metodzie, zuszczania, czyli usuwania suchej, zrogowaciaej warstwy naskrka. Prowadzi do gbokiego oczyszczenia i odblokowania porw skry, jej rewitalizacji, odwieenia i rozjanienia. Rodzaj kwasu dobierany indywidualnie do potrzeb skry.\r\n\r\n<strong>Wskazania:</strong>\r\n<ul>\r\n 	<li>Przebarwienia</li>\r\n 	<li>Zaskrniki, rozszerzone pory</li>\r\n 	<li>Nierwny koloryt</li>\r\n 	<li>Skra przetuszczajca si</li>\r\n 	<li>Blizny potrdzikowe</li>\r\n 	<li>Skra sucha, pozbawiona blasku</li>\r\n 	<li>Drobne zmarszczki</li>\r\n</ul>\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>stany zapalnie</li>\r\n 	<li>stany zakane</li>\r\n 	<li>stany alergiczne</li>\r\n 	<li>zakaenie bateryjne</li>\r\n 	<li>zakaenie wirusowe</li>\r\n 	<li>stosowanie retinoidw(pochodnej wit A)</li>\r\n 	<li>wiee rany, blizny, otarcia, oparzenia</li>\r\n 	<li>cia</li>\r\n 	<li>skonno do powstawania bliznowcw</li>\r\n</ul>\r\nPo zabiegu zuszczania kwasami naley unika ekspozycji na soce oraz basenu i sauny przez 2 tygodnie.\r\n\r\nCzas zabiegu: od 30 do 45 min.\r\n\r\n&nbsp;', 'Zuszczanie kwasami', '', 'publish', 'closed', 'closed', '', 'zluszczanie-kwasami', '', '', '2018-02-06 12:07:44', '2018-02-06 11:07:44', '', 984, 'http://192.168.1.42/beauty/?page_id=1134', 0, 'page', '', 0),
