(1140, 1, '2018-02-06 12:25:43', '2018-02-06 11:25:43', 'Zabieg eksfoliacyjny, przeznaczony do przeprowadzania kuracji redukujcej przebarwienia pigmentacyjne. Formua peelingu opiera si na roztworze kwasu mlekowego, komrek macierzystych Undari Pierzastodzielnej i Jewki Waskolistnej i zawartoci substancji rozjaniajcych, powodujcych inhibicj tyrozynazy, dziki czemu hamuj nadmiern melanogenez. Kwas mlekowy poczony z koktajlem czynnikw rozjaniajcych, skutecznie redukuj wszelkie przebarwienia, odwieaj koloryt i nawilaj.\r\n\r\nCzas zabiegu: 45 min.', 'Zabieg Lightening Lift Image SkinCare', '', 'publish', 'closed', 'closed', '', 'zabieg-lightening-lift-image-skincare', '', '', '2018-02-06 12:25:43', '2018-02-06 11:25:43', '', 984, 'http://192.168.1.42/beauty/?page_id=1140', 0, 'page', '', 0),
