(1146, 1, '2018-02-06 12:55:20', '2018-02-06 11:55:20', 'Wyjtkowy, autorski zabieg kosmetyczny stworzony dla cery dojrzaej o silnym dziaaniu regenerujcym i ujdrniajcym, czcy niezwyke waciwoci Soku Smocza Krewa (Dragons blood) z aktywnym Bio - krzemem. Unikalne poczenie skadnikw aktywnych sprawia, e natychmiast po zabiegu skra wyglda na modsz, wypoczt i zdrowsz.\r\n\r\nCzas zabiegu: 75 min.', 'Zabieg Skalpel Farmona', '', 'publish', 'closed', 'closed', '', 'zabieg-skalpel-farmona', '', '', '2018-02-06 12:55:20', '2018-02-06 11:55:20', '', 984, 'http://192.168.1.42/beauty/?page_id=1146', 0, 'page', '', 0),
