(1151, 1, '2018-02-06 13:04:00', '2018-02-06 12:04:00', 'Nasza skra codziennie naraona jest na dziaanie wielu niekorzystnych czynnikw takich jak  zanieczyszczenia rodowiska, klimatyzowane pomieszczenia, stres, promieniowanie UV, dym papierosowy. Idealn odpowiedzi na jej potrzeby jest kompleksowy zabieg ANTI POLLUTION, wykorzystujcy najnowsze odkrycia kosmetologii. Podstaw zabiegu jest innowacyjne poczenie skadnikw aktywnych, ktre dotleniaj, odwieaj i chroni skr przed przedwczesnym starzeniem.\r\n\r\nCzas zabiegu : 75 min.', 'Zabieg Anti Pollution Farmona', '', 'publish', 'closed', 'closed', '', 'zabieg-anti-pollution-farmona', '', '', '2018-02-06 13:04:00', '2018-02-06 12:04:00', '', 984, 'http://192.168.1.42/beauty/?page_id=1151', 0, 'page', '', 0),
