(1154, 1, '2018-02-06 13:10:17', '2018-02-06 12:10:17', 'Styl ycia, praca, nauka, dua ilo obowizkw sprawiaj, e nasz organizm potrzebuje coraz wicej energii. Najefektywniejszym paliwem dla naszego organizmu jest cukier. Niestety cukier ma nie tylko wpyw na nasz sylwetk, ale rwnie na kondycj i wygld skry. Proces glikacji stopniowo uszkadza struktur skry, czego rezultatem jest utrata elastycznoci i sprystoci, pojawiaj si powierzchniowe zmarszczki, zmienia si koloryt cery  skra staje si bardziej ta.\r\n\r\nZabieg antyglikacyjny ma za zadanie odwrci skutki wynikajce z procesu glikacji - zmniejszy ilo akumulowanych A.G.E. i degradacji GAGw. Przywraca elastyczno wknom biakowym, poprawia waciwoci biomechaniczne i widocznie odmadza skr.\r\n\r\nCzas zabiegu : 75 min.', 'Zabieg Anti A.G.E. Farmona', '', 'publish', 'closed', 'closed', '', 'zabieg-anti-a-g-e-farmona', '', '', '2018-02-06 13:10:17', '2018-02-06 12:10:17', '', 984, 'http://192.168.1.42/beauty/?page_id=1154', 0, 'page', '', 0),
(1155, 1, '2018-02-06 13:10:17', '2018-02-06 12:10:17', 'Styl ycia, praca, nauka, dua ilo obowizkw sprawiaj, e nasz organizm potrzebuje coraz wicej energii. Najefektywniejszym paliwem dla naszego organizmu jest cukier. Niestety cukier ma nie tylko wpyw na nasz sylwetk, ale rwnie na kondycj i wygld skry. Proces glikacji stopniowo uszkadza struktur skry, czego rezultatem jest utrata elastycznoci i sprystoci, pojawiaj si powierzchniowe zmarszczki, zmienia si koloryt cery  skra staje si bardziej ta.\r\n\r\nZabieg antyglikacyjny ma za zadanie odwrci skutki wynikajce z procesu glikacji - zmniejszy ilo akumulowanych A.G.E. i degradacji GAGw. Przywraca elastyczno wknom biakowym, poprawia waciwoci biomechaniczne i widocznie odmadza skr.\r\n\r\nCzas zabiegu : 75 min.', 'Zabieg Anti A.G.E. Farmona', '', 'inherit', 'closed', 'closed', '', '1154-revision-v1', '', '', '2018-02-06 13:10:17', '2018-02-06 12:10:17', '', 1154, 'http://192.168.1.42/beauty/2018/02/06/1154-revision-v1/', 0, 'revision', '', 0),
(1156, 1, '2018-02-06 13:12:09', '2018-02-06 12:12:09', 'Nasz wygld w zdecydowanej czci zdeterminowany jest przez nasze DNA. Geny, a dokadnie ich aktywno, wpywaj na kondycj skry i na wiek postrzegany, czyli to jak widz nas inni, pomimo naszego realnego wieku.\r\n\r\nNa wygld naszego ciaa, w szczeglnoci skry wpywaj geny, a dokadnie ich aktywno. Epigenetyka zajmuje si regulacj ekspresji genw aktywowanych przez czynniki rodowiskowe  promieniowanie UV, zanieczyszczenia, styl ycia), a genokosmetyki s now generacj produktw, ktrych dziaanie ukierunkowane jest na rdo zaburze skrnych wywoanych przez starzenie. Pozwalaj atakowa problem u jego rda, nie tylko tam, gdzie si objawia, ale przed wszystkim tam gdzie on powstaje.\r\n\r\nWraz z wiekiem szybko degradacji skadnikw skry jest wiksza, ni prdko ich powstawania, ktra maleje wraz w wiekiem.\r\n\r\nZabieg SKIN GENIC ma za zadanie aktywowa i chroni skr przed zmianami epigenetycznymi i widocznie przedua modo skry.\r\n\r\nCzas zabiegu: 75 min.', 'Zabieg Skin Genic Farmona', '', 'publish', 'closed', 'closed', '', 'zabieg-skin-genic-farmona', '', '', '2018-02-06 13:12:09', '2018-02-06 12:12:09', '', 984, 'http://192.168.1.42/beauty/?page_id=1156', 0, 'page', '', 0),
(1157, 1, '2018-02-06 13:12:09', '2018-02-06 12:12:09', 'Nasz wygld w zdecydowanej czci zdeterminowany jest przez nasze DNA. Geny, a dokadnie ich aktywno, wpywaj na kondycj skry i na wiek postrzegany, czyli to jak widz nas inni, pomimo naszego realnego wieku.\r\n\r\nNa wygld naszego ciaa, w szczeglnoci skry wpywaj geny, a dokadnie ich aktywno. Epigenetyka zajmuje si regulacj ekspresji genw aktywowanych przez czynniki rodowiskowe  promieniowanie UV, zanieczyszczenia, styl ycia), a genokosmetyki s now generacj produktw, ktrych dziaanie ukierunkowane jest na rdo zaburze skrnych wywoanych przez starzenie. Pozwalaj atakowa problem u jego rda, nie tylko tam, gdzie si objawia, ale przed wszystkim tam gdzie on powstaje.\r\n\r\nWraz z wiekiem szybko degradacji skadnikw skry jest wiksza, ni prdko ich powstawania, ktra maleje wraz w wiekiem.\r\n\r\nZabieg SKIN GENIC ma za zadanie aktywowa i chroni skr przed zmianami epigenetycznymi i widocznie przedua modo skry.\r\n\r\nCzas zabiegu: 75 min.', 'Zabieg Skin Genic Farmona', '', 'inherit', 'closed', 'closed', '', '1156-revision-v1', '', '', '2018-02-06 13:12:09', '2018-02-06 12:12:09', '', 1156, 'http://192.168.1.42/beauty/2018/02/06/1156-revision-v1/', 0, 'revision', '', 0);
