(1158, 1, '2018-02-06 13:17:12', '2018-02-06 12:17:12', 'Mezoterapia mikroigowa jest to zabieg wykonywany za pomoc specjalnie zaprojektowanego urzdzenia MezoPen do frakcyjnych mikronaku naskrka i skry waciwej.\r\n\r\nDziki systemowi pulsujcych igie uatwiajcemu dostarczanie substancji czynnych do naskrka i skry waciwej zapewnia stymulacj fibroblastw. Powstae mikrourazy skry wykorzystuj naturalne zdolnoci organizmu oraz wrodzon zdolno naprawy skry do fizjologicznej indukcji kolagenu. Mezoterapia mikroigowa tworzy w skrze mikrokanaliki, dziki ktrym moemy wprowadzi ampuki ze skadnikami aktywnymi.\r\n\r\n<strong>Wskazania:</strong>\r\n<ul>\r\n 	<li>Blizny</li>\r\n 	<li>Rozstpy</li>\r\n 	<li>Gbokie i utrwalone zmarszczki</li>\r\n 	<li>Utrata jdrnoci skry</li>\r\n 	<li>Przebarwienia i nierwny koloryt</li>\r\n</ul>\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>Stany zapalne skry</li>\r\n 	<li>Infekcje</li>\r\n 	<li>Alergia na skadniki preparatu</li>\r\n 	<li>Wszystkie choroby zakane</li>\r\n 	<li>Zakaenia wirusowe: opryszczka, brodawki, miczak zakany</li>\r\n 	<li>Zakaenia grzybicze</li>\r\n 	<li>Zakaenia bakteryjne: liszajec zakany</li>\r\n 	<li>Skonno do keloidw</li>\r\n 	<li>Zmiany ropne na skrze</li>\r\n 	<li>Cia i okres laktacji</li>\r\n 	<li>Choroby nowotworowe</li>\r\n 	<li>Zmniejszenie krzepliwoci krwi i przyjmowanie lekw zmniejszajcych krzepliwo krwi</li>\r\n</ul>\r\nEfekt zabiegu moe by widoczny ju po jednym zabiegu ale zaleca si wykonanie serii co najmniej 3 zabiegw w odstpie 2-4 tygodni. Ilo zabiegw zaley od rodzaju i problemw skry. Peen efekt widoczny jest w cigu miesica od ostatniego zabiegu.\r\n\r\nCzas rekonwalescencji po nakuciach trwa zwykle 3 dni.\r\n\r\nCzas zabiegu: 90 min.', 'Mezoterapia mikroigowa', '', 'publish', 'closed', 'closed', '', 'mezoterapia-mikroiglowa', '', '', '2018-02-06 13:17:12', '2018-02-06 12:17:12', '', 984, 'http://192.168.1.42/beauty/?page_id=1158', 0, 'page', '', 0),
