(1161, 1, '2018-02-06 13:41:14', '2018-02-06 12:41:14', 'Przy opracowywaniu zabiegu wykorzystano rewolucyjne <strong>odkrycie, nagrodzone w 2003 roku Nagrod Nobla w dziedzinie chemii. Chodzi o zjawisko elektroporacji</strong>, ktre powoduje reorganizacj bon komrkowych i w efekcie  zwikszenie przepuszczalnoci skry. To pozwala na bezbolesne wprowadzenie duej dawki substancji aktywnych o wysokim steniu  witamin, skadnikw mineralnych, skadnikw o dziaaniu nawilajcym, stymulujcym, agodzcym podranienia. Skadniki takiego koktajlu uwalniaj si natychmiastowo, poprawiajc kondycj skry i pozostawiajc efekt, ktry trwa. <strong>Zabieg jest doskona alternatyw do metod z zastosowaniem ostrzykiwania czy peelingw medycznych, ktre wymagaj przynajmniej kilku dni na powrt pacjenta do formy i cieszenie si penymi efektami</strong>.\r\n\r\n<strong>Zabieg Dermation to a 9 programw terapeutycznych na twarz i ciao:</strong>\r\n<ul>\r\n 	<li>Silnie nawilajcy</li>\r\n 	<li>Ujdrniajcy</li>\r\n 	<li>Przeciwzmarszczkowy</li>\r\n 	<li>Przeciwtrdzikowy</li>\r\n 	<li>Obkurczajcy naczynka</li>\r\n 	<li>Wygadzajcy blizny i rozstpy</li>\r\n 	<li>Rozjaniajcy przebarwienia</li>\r\n 	<li>Antycellulitowy</li>\r\n</ul>\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>metalowe elementy w ciele</li>\r\n 	<li>choroby serca</li>\r\n 	<li>rozrusznik serca</li>\r\n 	<li>epilepsja</li>\r\n 	<li>nadwraliwo skry</li>\r\n 	<li>stany zapalne skry</li>\r\n 	<li>alergia na skadniki kosmetykw</li>\r\n 	<li>cia i okres karmienia</li>\r\n</ul>\r\nCzas trwania: 35 min.', 'Zabieg Dermation', '', 'publish', 'closed', 'closed', '', 'zabieg-dermation', '', '', '2018-02-06 13:53:22', '2018-02-06 12:53:22', '', 984, 'http://192.168.1.42/beauty/?page_id=1161', 0, 'page', '', 0),
