(1169, 1, '2018-02-06 14:16:33', '2018-02-06 13:16:33', 'Elektrostymulator za pomoc delikatnych lecz gbokich impulsw elektrycznych stymuluje kompleksowo tkanki powierzchniowe i przenika w gb skry. Podczas zabiegu nastpuje pobudzenie przemiany materii i krenia krwi, redukcji ulega znaczna ilo podskrnej tkanki tuszczowej, wzrasta jdrno i elastyczno skry. Prd pobudza minie do rytmicznych skurczw porwnywalnych z tymi jakie pojawiaj si podczas wicze fizycznych.\r\n\r\n<strong>Wskazania:</strong>\r\n<ul>\r\n 	<li>redukcja tkanki tuszczowej z najbardziej opornych w terapii obszarw, takich jak: brzuch, uda czy poladki</li>\r\n 	<li>redukcja wagi</li>\r\n 	<li>wzmocnienie i zwikszenie siy mini</li>\r\n 	<li>wyrzebienie i wysmuklenie sylwetki</li>\r\n 	<li>redukcja cellulitu i wyrwnanie powierzchni skry</li>\r\n 	<li>poprawa ukrwienia, odywienia i dotlenienia skry</li>\r\n 	<li>przyspieszenie produkcji kolagenu i elastyny</li>\r\n 	<li>poprawa elastycznoci, napicia i kolorytu skry</li>\r\n</ul>\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>wszczepiony rozrusznik serca,</li>\r\n 	<li>metalowe protezy,</li>\r\n 	<li>przy zabiegach na brzuch  wkadka domaciczna,</li>\r\n 	<li>epilepsja (zabieg moliwy wycznie pod nadzorem lekarza),</li>\r\n 	<li>niedawno przebyty zabieg chirurgiczny,</li>\r\n 	<li>ylaki  przy zabiegach na nogi,</li>\r\n 	<li>cia</li>\r\n</ul>', 'Elektrostymulacja', '', 'publish', 'closed', 'closed', '', 'elektrostymulacja', '', '', '2018-02-06 14:18:12', '2018-02-06 13:18:12', '', 984, 'http://192.168.1.42/beauty/?page_id=1169', 0, 'page', '', 0),
