(1174, 1, '2018-02-06 14:24:23', '2018-02-06 13:24:23', 'Liposukcja ultradwikowa jest bezinwazyjnym zabiegiem polegajcym na odsysaniu nadmiernie nagromadzonej tkanki tuszczowej z takich miejsc, jak: biodra, poladki, uda, brzuch. Liposukcja bez skalpela odbywa si przez zastosowanie ultradwikw, ktre rozbijaj bony komrkowe komrek tuszczowych.\r\n\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>cia i okres laktacji</li>\r\n 	<li>nieunormowane cinienie ttnicze</li>\r\n 	<li>choroby nowotworowe przed upywem 5 lat od ich wyleczenia</li>\r\n 	<li>niewydolno krenia</li>\r\n 	<li>stany wyniszczenia czynna grulica puc</li>\r\n 	<li>zaawansowana miadyca obwodowa</li>\r\n 	<li>zmiany ylno-chonne</li>\r\n 	<li>zakrzepowa choroba y koczyn dolnych</li>\r\n 	<li>stany bakteryjne skry i tkanek mikkichkrwawienia</li>\r\n 	<li>przerwana cigo naskrka</li>\r\n 	<li>implanty metalowe w okolicach zabiegowych</li>\r\n 	<li>rozruszniki serca, zastawka</li>\r\n</ul>', 'Liposukcja ultradwikowa', '', 'publish', 'closed', 'closed', '', 'liposukcja-ultradzwiekowa', '', '', '2018-02-06 14:24:23', '2018-02-06 13:24:23', '', 984, 'http://192.168.1.42/beauty/?page_id=1174', 0, 'page', '', 0),
