(1181, 1, '2018-02-06 14:32:33', '2018-02-06 13:32:33', '<strong>Masa bak chisk</strong> dziaa niczym drena limfatyczny. Poprawia krenie krwi, przyspiesza metabolizm i usuwa nadmiar toksycznych substancji. Dziki temu moliwe jest przyspieszenie procesw spalania tkanki tuszczowej i widoczna redukcja cellulitu. Komrki staj si znacznie lepiej odywione, co jest efektem zwikszenia przepywu substancji odywczych. Mniejsze staj si te obrzki, dziki poprawie krenia i dziaania ukadu limfatycznego.\r\n\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>Cia</li>\r\n 	<li>Miesiczka</li>\r\n 	<li>ylaki i skonno do pkajcych naczynek</li>\r\n 	<li>Stany zapalne skry</li>\r\n 	<li>Gorczka</li>\r\n</ul>', 'Masa bak chisk', '', 'publish', 'closed', 'closed', '', 'masaz-banka-chinska', '', '', '2018-02-06 14:32:33', '2018-02-06 13:32:33', '', 984, 'http://192.168.1.42/beauty/?page_id=1181', 0, 'page', '', 0),
