(1184, 1, '2018-02-06 14:36:31', '2018-02-06 13:36:31', 'Depilacja laserowa (fotoepilacja) suy trwaemu usuniciu owosienia. Metoda ta polega na uszkodzeniu macierzy wosa przez wiato lasera, ktre jest absorbowane przez melanin znajdujc si w cebulce wosa bdcego w fazie wzrostu.\r\n\r\nPrzygotowanie do zabiegu:\r\n<ul>\r\n 	<li>podczas zabiegu woski powinny mie dugo 2-3 milimetry</li>\r\n 	<li>przed zabiegiem nie naley wyrywa woskw depilatorem, woskiem, pset</li>\r\n 	<li>najczciej wystpujcym przeciwwskazaniem jest opalenizna na skrze (soce, solarium, samoopalacze) - naley odczeka wwczas okoo 4-6 tygodni, aby skra zjaniaa</li>\r\n</ul>\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>cia (cay okres), karmienie piersi (pierwsze 3 miesice)</li>\r\n 	<li>opalenizna - powstaa na skutek soca, solarium, samoopalacza (min. 4-6 tygodni)</li>\r\n 	<li>stosowanie kremu z: retinolem (miesic przed zabiegiem), witaminami C, A, E lub kwasami owocowymi (naley zaprzesta stosowania na tydzie przed zabiegiem)</li>\r\n 	<li>zaywanie witamin A lub E oraz beta karotenu - naley zaprzesta na tydzie przed zabiegiem</li>\r\n 	<li>leki rozrzedzajce krew np.: Aspiryna, Fervex, Gripex - naley zaprzesta stosowania do 48 godzin przed zabiegiem, heparyna - 2 tygodnie przed zabiegiem</li>\r\n 	<li>antybiotyki - nie stosowa do 14 dni przed zabiegiem</li>\r\n 	<li>antybiotyki dermatologiczne: Tetracyklina lub Roaccutane (leki na trdzik) - przerwa miedzy ostatni dawk, a zabiegiem powinna wynie ok. 6 miesicy</li>\r\n 	<li>przyjmowanie zi wiatouczulajcych (dziurawiec, nagietek, bratek) naley nie stosowa do 7 dni przed zabiegiem</li>\r\n 	<li>obecno zmian barwnikowych, przeronite pieprzyki</li>\r\n 	<li>bielactwo, uszczyca, skonnoci do bliznowacenia</li>\r\n 	<li>cukrzyca - gwnie przy zaburzeniach odczucia blu</li>\r\n 	<li>choroby nowotworowe</li>\r\n 	<li>epilepsja (padaczka)</li>\r\n 	<li>nadcinienie nieleczone lub nieunormowane</li>\r\n</ul>', 'Fotoepilacja', '', 'publish', 'closed', 'closed', '', 'fotoepilacja', '', '', '2018-02-06 14:36:31', '2018-02-06 13:36:31', '', 984, 'http://192.168.1.42/beauty/?page_id=1184', 0, 'page', '', 0),
